// src/pages/WarriorEdge.tsx
import React, { useEffect } from 'react';
import LightweightChart from '../components/LightweightChart';
import SetupFeed from '../components/SetupFeed';
import SetupReview from '../components/SetupReview';
import SetupExport from '../components/SetupExport';
import { logSetup, getSetupLog } from '../alerts/setupLogger';
import type { ICCSetup } from '../types/ICC';

const WarriorEdge: React.FC = () => {
  useEffect(() => {
    logSetup({
      symbol: 'META',
      timeframe: '1m',
      source: 'ICC Warrior Scanner',
      dashboard: 'WarriorEdge',
      iccTags: ['Scalp', 'HighVolatility'],
      timeBlock: 'LateMorning',
      priceAtTrigger: 312.7,
      outcome: 'Pending',
      bot: 'TestBot',
      timestamp: new Date().toISOString(),
    });
  }, []);

  const latestSetup: ICCSetup | undefined = getSetupLog()
    .filter(s => s.dashboard === 'WarriorEdge')
    .slice(-1)[0];

  return (
    <div style={{ padding: '2rem' }}>
      <h2>üõ°Ô∏è WarriorEdge ‚Äî Scalps & High Volatility Plays</h2>

      <div style={{ marginBottom: '1.5rem', overflowX: 'auto' }}>
        {latestSetup && (
          <LightweightChart
            data={[
              {
                time: latestSetup.timestamp,
                value: latestSetup.priceAtTrigger,
              },
            ]}
            overlays={{ vwap: true, triggers: [latestSetup] }}
          />
        )}
      </div>

      <SetupFeed
        entries={getSetupLog().filter(s => s.dashboard === 'WarriorEdge')}
        dashboard="WarriorEdge"
      />
      <SetupReview
        entries={getSetupLog().filter(s => s.dashboard === 'WarriorEdge')}
        dashboard="WarriorEdge"
      />
      <SetupExport dashboard="WarriorEdge" />
    </div>
  );
};

export default WarriorEdge;
